import React, { useState } from 'react';
import axios from 'axios';

const api = axios.create({
  baseURL: 'http://localhost:5000/api',
  withCredentials: true 
});

function App() {
  const [loading, setLoading] = useState(false);
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [dayStarted, setDayStarted] = useState(false);
  const [officerName, setOfficerName] = useState("");

  // --- LOGIN LOGIC ---
  const handleLogin = async () => {
    if (!officerName) return alert("Please enter Officer Name");
    setLoading(true);
    try {
      await api.post('/login', { officerId: "OFF123", name: officerName });
      setIsLoggedIn(true);
      alert("Login Successful!");
    } catch (err) {
      alert("Login Failed");
    }
    setLoading(false);
  };

  const getVerifiedLocation = () => {
    return new Promise((resolve, reject) => {
      navigator.geolocation.getCurrentPosition(
        (pos) => resolve({ lat: pos.coords.latitude, lng: pos.coords.longitude }),
        (err) => reject("Enable GPS!"),
        { enableHighAccuracy: true }
      );
    });
  };

  const startDay = async () => {
    setLoading(true);
    try {
      const loc = await getVerifiedLocation();
      await api.post('/activity/start-day', loc);
      setDayStarted(true);
      alert("Day Started!");
    } catch (err) {
      alert(err.response?.data?.error || "Error");
    }
    setLoading(false);
  };

  const logMeeting = async (type) => {
    setLoading(true);
    try {
      const loc = await getVerifiedLocation();
      await api.post('/activity/log-meeting', {
        type, lat: loc.lat, lng: loc.lng, photo: "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAADUlEQVR42mP8/5+hHgAHggJ/PchI7wAAAABJRU5ErkJggg=="
      });
      alert(`${type} Meeting Logged!`);
    } catch (err) {
      alert(err.response?.data?.error);
    }
    setLoading(false);
  };

  const endDay = async () => {
    setLoading(true);
    try {
      const res = await api.post('/activity/end-day');
      alert(`SUMMARY: ${res.data.summary.totalMeetings} Meetings, ${res.data.summary.distanceKM} KM`);
      setDayStarted(false);
    } catch (err) {
      alert(err.response?.data?.error);
    }
    setLoading(false);
  };

  // --- UI SCREENS ---
  if (!isLoggedIn) {
    return (
      <div style={styles.app}>
        <h2>OCCAMY LOGIN</h2>
        <input 
          type="text" 
          placeholder="Enter Officer Name" 
          style={styles.input} 
          onChange={(e) => setOfficerName(e.target.value)}
        />
        <button onClick={handleLogin} style={styles.bigGreenBtn}>LOGIN</button>
      </div>
    );
  }

  return (
    <div style={styles.app}>
      <h2>Officer: {officerName}</h2>
      {!dayStarted ? (
        <button onClick={startDay} style={styles.bigGreenBtn}>START DAY</button>
      ) : (
        <>
          <button onClick={() => logMeeting('Farmer')} style={styles.meetingBtn}>LOG FARMER</button>
          <button onClick={() => logMeeting('Distributor')} style={styles.meetingBtn}>LOG DISTRIBUTOR</button>
          <button onClick={endDay} style={styles.bigRedBtn}>END DAY</button>
        </>
      )}
    </div>
  );
}

const styles = {
  app: { padding: '20px', textAlign: 'center' },
  input: { padding: '15px', width: '80%', fontSize: '18px', marginBottom: '20px', borderRadius: '10px', border: '1px solid #ccc' },
  bigGreenBtn: { backgroundColor: '#28a745', color: 'white', width: '100%', padding: '25px', fontSize: '20px', fontWeight: 'bold', border: 'none', borderRadius: '15px' },
  bigRedBtn: { backgroundColor: '#dc3545', color: 'white', width: '100%', padding: '20px', fontSize: '20px', marginTop: '30px', border: 'none', borderRadius: '15px' },
  meetingBtn: { backgroundColor: '#007bff', color: 'white', width: '100%', padding: '25px', fontSize: '18px', margin: '10px 0', border: 'none', borderRadius: '10px' }
};

export default App;
